import './App.css';
import ButtonAppBar from './ButtonAppBar';
import { Paper, FormControl } from '@mui/material';

function App() {
  return (
    <div className="App">
      <ButtonAppBar />
      <FormControl>
        <Paper elevation={3}>
          Stuff
        </Paper>
      </FormControl>
    </div>
  );
}

export default App;
